        /// <summary>
        /// Gets the report select expression.
        /// </summary>
        /// <param name="reportDataSelectComponents">The report data select components.</param>
        /// <returns></returns>
        public Expression<Func<IEntity, object>> GetReportSelectExpression( IList<DataSelectComponent> reportDataSelectComponents )
        {
            Expression<Func<IEntity, object>> result = null;
            int componentCount = reportDataSelectComponents.Count();

            PopulatePrimitives( reportDataSelectComponents );

            // use reflection to call GetSelectionExpressionX
            var selectExpressionMethod = typeof( ReportExpressionSelector ).GetMethod( "GetSelectExpression" + componentCount.ToString(), System.Reflection.BindingFlags.NonPublic | System.Reflection.BindingFlags.Instance );
            result = selectExpressionMethod.Invoke(this, new object[] {}) as Expression<Func<IEntity, object>>;

            return result;
        }

        /// <summary>
        /// Populates the primitives.
        /// </summary>
        /// <param name="reportDataSelectComponents">The report data select components.</param>
        private void PopulatePrimitives( IList<DataSelectComponent> reportDataSelectComponents )
        {
            // use Reflection to set all 200 variables vs having hundreds of lines of code to do it
            for ( int i = 0; i < reportDataSelectComponents.Count(); i++ )
            {
                string selection = string.Empty;//TODO reportDataSelectComponents[i];

                var dataQryField = typeof( ReportExpressionSelector ).GetField( "DataQry" + i.ToString(), System.Reflection.BindingFlags.NonPublic | System.Reflection.BindingFlags.Instance );
                dataQryField.SetValue( this, reportDataSelectComponents[i].SubQuery( selection ) );

                var selectExpressionField = typeof( ReportExpressionSelector ).GetField( "SelectExpression" + i.ToString(), System.Reflection.BindingFlags.NonPublic | System.Reflection.BindingFlags.Instance );
                selectExpressionField.SetValue( this, reportDataSelectComponents[i].SelectExpression );
            }
        }

